import React from "react";

const Skills = () => {
    return (
        <section className="scroll-section">
            <div className="skills-content">
                <h2>Skills</h2>
                <ul>
                    <li>Unity / C#</li>
                    <li>React.js / Vue.js</li>
                </ul>
            </div>
        </section>
    );
};

export default Skills;
